part of 'models.dart';

UserModel userModelFromJson(String str) => UserModel.fromJson(json.decode(str));

String userModelToJson(UserModel data) => json.encode(data.toJson());

class UserModel {
  UserModel({
    required this.user,
  });

  final User user;

  factory UserModel.fromJson(Map<String, dynamic> json) => UserModel(
        user: User.fromJson(json["data"]),
      );

  Map<String, dynamic> toJson() => {
        "data": user.toJson(),
      };
}

class User {


  User(
      {required this.idGenUsuario,
      required this.idGenPersona,
      required this.nombreUsuario,
      required this.apenom,
      required this.documento,
      required this.sexoPerson,
      required this.token,
      required this.session,
      required this.motivo,
      required this.actualizarApp,
      this.foto,
      this.fotoString});

  String idGenUsuario;
  final String idGenPersona;
  final String nombreUsuario;
  final String apenom;
  final String documento;
  final String sexoPerson;
  final Token token;
  final bool session;
  final String motivo;
  final bool actualizarApp;
  String? fotoString;
  Uint8List? foto;



  factory User.empty({String name = ''}) => User(
      idGenUsuario: '0',
      idGenPersona: '0',
      nombreUsuario: '',
      apenom: name,
      documento: '',
      sexoPerson: '',
      token: Token(request: '', expired: ''),
      session: false,
      motivo: '',
      actualizarApp: false,
      fotoString: null,
      foto: null);

  factory User.fromJson(Map<String, dynamic> json) {
    String mifoto="data:image/png;base64,";

    return User(
      idGenUsuario: json["idGenUsuario"],
      idGenPersona: json["idGenPersona"],
      nombreUsuario: json["nombreUsuario"],
      apenom: json["apenom"],
      documento: json["documento"],
      sexoPerson: json["sexoPerson"],
      token: Token.fromJson(json["token"]),
      session: json["session"],
      motivo: json["motivo"],

      actualizarApp: json["actualizarApp"],

      foto: PhotoHelper.convertStringToUint8List(mifoto),
      fotoString: mifoto
      /*foto: PhotoHelper.convertStringToUint8List(json["foto"]),
      fotoString: json["foto"]*/
    );
  }

  Map<String, dynamic> toJson() => {
        "idGenUsuario": idGenUsuario,
        "idGenPersona": idGenPersona,
        "nombreUsuario": nombreUsuario,
        "apenom": apenom,
        "documento": documento,
        "sexoPerson": sexoPerson,
        "token": token.toJson(),
        "session": session,
        "motivo": motivo,
        "actualizarApp": actualizarApp,
        "foto": fotoString,
      };
}

class Token {
  Token({
    required this.request,
    required this.expired,
  });

  final String request;
  final String expired;

  factory Token.fromJson(Map<String, dynamic> json) => Token(
        request: json["request"],
        expired: json["expired"],
      );

  Map<String, dynamic> toJson() => {
        "request": request,
        "expired": expired,
      };
}
